    private async Task EditShift()
    {
        try
        {
            await shiftService.EditShift(shift);
            errorMessage = "";
            NavigationManager.NavigateTo("/ManageShift");
        }
        catch (Exception e)
        {
            Console.WriteLine(e.Message);
            errorMessage = e.Message;
        }
